import React, { useState } from 'react';
import { useNavigate } from "react-router-dom";
import { Button, Col, Form, FloatingLabel, Row, Tab, Tabs } from 'react-bootstrap';

const UserForm = () => {
    const [validated, setValidated] = useState(false);
    const navigate = useNavigate();

    const handleFormSubmit = async (event, role) => {
        event.preventDefault();
        const form = event.currentTarget;

        if (form.checkValidity() === false) {
            event.stopPropagation();
        } else {
            const email = form.querySelector('input[type="email"]').value;
            const password = form.querySelector('input[type="text"]').value;
            const rememberMe = form.querySelector('input[type="checkbox"]')?.checked || false;

            try {
                const response = await fetch("http://localhost:8000/login/", {
                    method: "POST",
                    headers: { "Content-Type": "application/json" },
                    body: JSON.stringify({
                        username: email,
                        password: password,
                        remember_me: rememberMe,
                        role: role
                    }),
                });

                const data = await response.json();

                if (!response.ok) {
                    alert(data.error || "Login failed.");
                } else if (data.role !== role) {
                    alert(`You are not authorized to log in as ${role}.`);
                } else {
                    alert("Login successful!");
                    navigate(role === "admin" ? "/nestcafe/pages/overview" : "/nestcafe/pages/ToDO");
                }
            } catch (error) {
                console.error("Login error", error);
                alert("Something went wrong.");
            }
        }

        setValidated(true);
    };

    return (
        <div className='form-area rounded'>
            <div className='mt-4 me-4 mx-4 pb-4 auto'>
                <Tabs defaultActiveKey="user" id="login-tabs" className="mb-3" style={{ background: '#9c8386' }}>
                    <Tab eventKey="user" title="User">
                        <Form noValidate validated={validated} onSubmit={(e) => handleFormSubmit(e, 'user')}>
                            <Row className="mb-3">
                                <Col md="12">
                                    <Form.Label>Email</Form.Label>
                                    <FloatingLabel label="Email address" className="mb-3">
                                        <Form.Control required type="email" placeholder="name@example.com" />
                                        <Form.Control.Feedback type="invalid">Please provide your email address.</Form.Control.Feedback>
                                    </FloatingLabel>
                                </Col>
                            </Row>
                            <Row className="mb-3">
                                <Col md="12">
                                    <Form.Label>Password</Form.Label>
                                    <FloatingLabel label="Password" className="mb-2">
                                        <Form.Control required type="text" placeholder="Password" />
                                        <Form.Control.Feedback type="invalid">Please provide your password.</Form.Control.Feedback>
                                    </FloatingLabel>
                                </Col>
                                <Form.Group className="mb-3" controlId="formBasicCheckbox">
                                    <Form.Check type="checkbox" label="Remember me" />
                                </Form.Group>
                            </Row>
                            <Button variant='outline-dark' size='lg' type="submit" id='loginbtn'>Login</Button>
                        </Form>
                    </Tab>

                    <Tab eventKey="admin" title="Admin">
                        <Form noValidate validated={validated} onSubmit={(e) => handleFormSubmit(e, 'admin')}>
                            <Row className="mb-3">
                                <Col md="12">
                                    <Form.Label>Email</Form.Label>
                                    <FloatingLabel label="Email address" className="mb-3">
                                        <Form.Control required type="email" placeholder="name@example.com" />
                                        <Form.Control.Feedback type="invalid">Please provide your email address.</Form.Control.Feedback>
                                    </FloatingLabel>
                                </Col>
                            </Row>
                            <Row className="mb-3">
                                <Col md="12">
                                    <Form.Label>Password</Form.Label>
                                    <FloatingLabel label="Password" className="mb-2">
                                        <Form.Control required type="text" placeholder="Password" />
                                        <Form.Control.Feedback type="invalid">Please provide your password.</Form.Control.Feedback>
                                    </FloatingLabel>
                                </Col>
                            </Row>
                            <Button variant='outline-dark' size='lg' type="submit" id='loginbtn'>Login</Button>
                        </Form>
                    </Tab>
                </Tabs>
            </div>
        </div>
    );
};

export default UserForm;
